import styled from "styled-components";

export const Section = styled.section`
  padding: 20px 0;
`;

export const Title = styled.p`
  font-size: 36px;
  font-weight: bold;
  letter-spacing: 2px;
`;

export const Text = styled.p`
  font-size: 18px;
  margin: 20px 0;
`;
